import { useState } from "react";
import "./App.css";

const App = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    gender: "",
    skills: [],
    country: "",
    dob: "",
    message: "",
    terms: false
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (name === "skills") {
      setFormData(prev => ({
        ...prev,
        skills: checked
          ? [...prev.skills, value]
          : prev.skills.filter(s => s !== value)
      }));
    } else {
      setFormData({
        ...formData,
        [name]: type === "checkbox" ? checked : value
      });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    await fetch("http://localhost:5000/submit-form", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData)
    });

    alert("Form Submitted Successfully ðŸš€");
  };

  return (
    <div className="form-container">
      <h2>Full Stack Form</h2>

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Name</label>
          <input name="name" onChange={handleChange} />
        </div>

        <div className="form-group">
          <label>Email</label>
          <input type="email" name="email" onChange={handleChange} />
        </div>

        <div className="form-group">
          <label>Password</label>
          <input type="password" name="password" onChange={handleChange} />
        </div>

        <div className="form-group">
          <label>Gender</label>
          <div className="radio-group">
            <label><input type="radio" name="gender" value="Male" onChange={handleChange} /> Male</label>
            <label><input type="radio" name="gender" value="Female" onChange={handleChange} /> Female</label>
          </div>
        </div>

        <div className="form-group">
          <label>Skills</label>
          <div className="checkbox-group">
            <label><input type="checkbox" name="skills" value="HTML" onChange={handleChange} /> HTML</label>
            <label><input type="checkbox" name="skills" value="CSS" onChange={handleChange} /> CSS</label>
            <label><input type="checkbox" name="skills" value="React" onChange={handleChange} /> React</label>
          </div>
        </div>

        <div className="form-group">
          <label>Country</label>
          <select name="country" onChange={handleChange}>
            <option value="">Select Country</option>
            <option value="India">India</option>
            <option value="USA">USA</option>
          </select>
        </div>

        <div className="form-group">
          <label>Date of Birth</label>
          <input type="date" name="dob" onChange={handleChange} />
        </div>

        <div className="form-group">
          <label>Message</label>
          <textarea name="message" onChange={handleChange}></textarea>
        </div>

        <div className="form-group terms">
          <input type="checkbox" name="terms" onChange={handleChange} />
          <span>I accept all terms & conditions</span>
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default App;
